import Badges from '../pages/Badges';
// import Badge from './Badge';
import Badge2 from './Badge2';
import Badge3 from './Badge3';
import Badge4 from './Badge4';

const App2 = () => {
    return (
        <div className="App">

        <Badges title="Condena" >
        {/* <Badge /> */}
        <Badge2 />
        <Badge3 />
        <Badge4 />
        </Badges>
        
    </div>
    )
}

export default App2;
